import Product from './Product.js';

export default function Main(props) {
    const { item, onAdd, products } = props;
    // const { products} = dataa;
    return (
        <>
           
            <div className='df-2'>
                <div className="Pod df">
                    
                    {products.map((product) => (
                        <Product key={product.id} product={product}></Product>
                    ))}
                </div>

                <div className="food df">
                    {products.map((product) => (
                        <Foods key={product.id} product={product}></Foods>
                    ))}
                </div>

            </div>

            {/* <div className="d-flex-4">
                   {products.map((item) => {
                  <Foods key={item.id} item={item} onAdd={onAdd}></Foods>

              } )} */}




        </>
    )
}
